{% block extra_script %}
<script>
    $("#projects").show();

    $("#upload_btn").click(function () {
        $("#excelFile").click();
    });


    $("#excelFile").change(function () {
        $("#preloader").show();
        $("#ctn-preloader").removeClass("loaded");

        var fileInput = this.files[0];
        if (!fileInput) {
            alert("Please select a file first!");
            return;
        }

        var formData = new FormData();
        formData.append("file", fileInput);

        setTimeout(() => {
            location.reload();
        }, 2000);
    });

</script>

{% endblock %}
